//nolint:revive,govet,errcheck
package marsh

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MARSH_MANUAL_SETPOINT_MODE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MARSH_MANUAL_SETPOINT_MODE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MARSH_MANUAL_SETPOINT_MODE_TARGET.MarshalText()
		require.NoError(t, err)

		var dec MARSH_MANUAL_SETPOINT_MODE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MARSH_MANUAL_SETPOINT_MODE_TARGET, dec)
	})
}
